import React from 'react';
import styled from "styled-components"
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom"
import { CPage, CLogo, CLink, CButton } from "@appcues/component-library";

import FlowList from "./flow-list.svg";

const Logo = styled(CLogo)`
  max-height: 100%;
  height: 100%;
  margin: 0 auto;
  width: 200px;
`;

const Header = styled.div`
  width: 100%;
  text-align: center;
  margin: 10em;
`;

const Navigation = styled.div`
  width: 100%;
  margin: 1em;
`;

function App() {
  return (
    <Router>
    <Header>
    <Logo/>
    <Navigation>
    <Link to="/">Home</Link> | 
    <Link to="/analytics">Analytics</Link>
    </Navigation>
    </Header>
    <Switch>
    <Route path="/analytics">
    </Route>
    <Route path="/">
    <img src={FlowList}/>
    </Route>
    </Switch>
    </Router>
  );
}

export default App;
